  Platform,
  StyleSheet,
  Text,
  View,
  Button,
  AsyncStorage,
  Alert,
  BackHandler,
  TouchableOpacity,
  ToastAndroid,
} from 'react-native';

import api from '../services/api';

import parseErrorStack from 'react-native/Libraries/Core/Devtools/parseErrorStack';

export default function SignOut(){

    const onSignOutAlert = () => {
        Alert.alert(
            'Deseja mesmo sair?',
            '',

        [
            {text: 'Sim', onPress: () => onSignOut()},
            {text: 'Não'}
        ],
        {cancelable: false}
        )
    }

    const onSignOut = () => {
    const removeStorageToken = async () => {
        return await AsyncStorage.removeItem('task-token').then(() => {
            ToastAndroid.show('Sucessooooooo', ToastAndroid.SHORT)
            BackHandler.exitApp()
        }).catch(err => console.log('SignOut removeStorageToken err: ', err))
    }
}



    return (
        <View>
          <TouchableOpacity onPress={onSignOutAlert}>
              <Text>SingOut</Text>
          </TouchableOpacity>

        </View>
      );


 }
